import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import { View, Text, Button, FlatList, TouchableOpacity } from 'react-native';

const Tab = createMaterialTopTabNavigator();

function MealPlanScreen({ addFavorite }) {
  const [mealPlan, setMealPlan] = useState([]);

  const generateMealPlan = () => {
    setMealPlan(['Meal 1', 'Meal 2', 'Meal 3']);
  };

  return (
    <View>
      <Text>Your Weekly Meal Plan</Text>
      <Button title="Generate Meal Plan" onPress={generateMealPlan} />
      <FlatList
        data={mealPlan}
        renderItem={({ item }) => (
          <View>
            <Text>{item}</Text>
            <Button title="Add to Favorites" onPress={() => addFavorite(item)} />
          </View>
        )}
        keyExtractor={(item, index) => index.toString()}
      />
    </View>
  );
}

function FavoritesScreen({ favorites }) {
  return (
    <View>
      <Text>Your Favorites</Text>
      <FlatList
        data={favorites}
        renderItem={({ item }) => <Text>{item}</Text>}
        keyExtractor={(item, index) => index.toString()}
      />
    </View>
  );
}

function ArticlesScreen({ readArticle, articles }) {
  return (
    <View>
      <Text>Daily Articles</Text>
      <Button title="Read Today's Articles" onPress={readArticle} />
      <FlatList
        data={articles}
        renderItem={({ item }) => <Text>{item}</Text>}
        keyExtractor={(item, index) => index.toString()}
      />
    </View>
  );
}

function RegionScreen({ region, setRegion }) {
  return (
    <View>
      <Text>Regional Menus</Text>
      <Text>Explore popular dishes from your region: {region}</Text>
      <Picker
        selectedValue={region}
        onValueChange={(itemValue) => setRegion(itemValue)}
      >
        <Picker.Item label="Your Region" value="Your Region" />
        <Picker.Item label="Region 1" value="Region 1" />
        <Picker.Item label="Region 2" value="Region 2" />
      </Picker>
    </View>
  );
}

function InstacartScreen({ handleInstacart }) {
  return (
    <View>
      <Text>Instacart Integration</Text>
      <Button title="Add Ingredients to Instacart" onPress={handleInstacart} />
    </View>
  );
}

function App() {
  const [favorites, setFavorites] = useState([]);
  const [articles, setArticles] = useState([]);
  const [region, setRegion] = useState('Your Region');

  const addFavorite = (meal) => {
    setFavorites([...favorites, meal]);
  };

  const readArticle = () => {
    setArticles(['Article 1', 'Article 2']);
  };

  const handleInstacart = () => {
    alert('Ingredients added to Instacart!');
  };

  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Meal Plan">
          {() => <MealPlanScreen addFavorite={addFavorite} />}
        </Tab.Screen>
        <Tab.Screen name="Favorites">
          {() => <FavoritesScreen favorites={favorites} />}
        </Tab.Screen>
        <Tab.Screen name="Articles">
          {() => <ArticlesScreen readArticle={readArticle} articles={articles} />}
        </Tab.Screen>
        <Tab.Screen name="Region">
          {() => <RegionScreen region={region} setRegion={setRegion} />}
        </Tab.Screen>
        <Tab.Screen name="Instacart">
          {() => <InstacartScreen handleInstacart={handleInstacart} />}
        </Tab.Screen>
      </Tab.Navigator>
    </NavigationContainer>
  );
}

export default App;
